webpackJsonp([79692441475788],{359:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Today, well... last night technically marks my first steps into Web Dev. After doing a few Google searches and some reading on Reddit I found a plentiful amount of wonderful resources. One in particular that has stood out is <a href="https://www.theodinproject.com/courses/web-development-101">The Odin Project</a>. So far it looks like a promising guide to understanding Web Dev. My expectations were originally to understand HTML and CSS but the guide also gives a good intro to Javascript - very exciting!</p>\n<p>I am super eager to read further into the guide and do some learning!</p>\n<p>On a side note, here\'s a great video I enjoyed watching that was suggested by the site and produced by <a href="https://www.khanacademy.org/talks-and-interviews/conversations-with-sal/a/the-learning-myth-why-ill-never-tell-my-son-hes-smart">Khan Academy</a>.</p>\n<iframe width="560" height="315" src="https://www.youtube.com/embed/JC82Il2cjqA" frameborder="0" allowfullscreen></iframe> ',frontmatter:{title:"First Steps Into Web Development"}}},pathContext:{slug:"/2017-06-26-rick-boshae-first-steps-into-web-development/"}}}});
